description:
L’Action d’Enabel s’inscrit dans le programme RIMDIR en Mauritanie financé par l’Union Européenne sur le 11ème FED (35 Mo EUR). Le RIMDIR est le second des trois programmes  prévus dans le secteur de concentration sécurité alimentaire et agriculture durable de l’UE.
Le programme RIMDIR est structuré en trois composantes : 
A) Construction/Réhabilitation et appui à la gestion d’infrastructures rurales productives ;
B) Développement de services d’accès à l’énergie renouvelable ;
C) Renforcement institutionnel et coordination/suivi évaluation, formations et accompagnement des acteurs.
Il s’agira essentiellement pour Enabel de mettre en œuvre les composantes A et C (25 Mo EUR). La composante B sera en principe confiée à l’AFD.
